import react from "react";
import GaugeChart from 'react-advanced-gauge-chart'


const Displaying = ({sensor}) => {
   let sensordata = sensor.sensordata;

    return (
        <tr>
        <th scope="row">{sensor.sensorid}</th>
        <td>{sensor.sensorname}</td>
        <td>{sensor.sensordata}</td>
        <td>
        <div class="progress">
          <div class="progress-bar" role="progressbar" aria-valuenow={sensordata}
              aria-valuemin="0" aria-valuemax="100" style={{width:`${sensordata}%`}}>
              {sensordata} %
          </div>
        </div>        
        </td>
      </tr>
      );
}

export default Displaying;
